import React from 'react'
import DeleteSongButton from './deleteSongButton'
import { useSongs, useGigInfo } from './util/hooks'

const Songs = () => {
  const { songs } = useSongs()

  if (songs) {
    console.log(songs.length)
    if (songs.length)
    return (
      <div>
        <p>no songs</p>
      </div>
    )
  } else {
    return (
      <div>
      <p>there are songs</p>
      </div>
    )
  }
}

export default Songs
